(8, 1, '2022-07-26 16:36:18', '2022-07-26 14:36:18', '<h2>Nos activités</h2>		\n			<figure><img width=\"696\" height=\"522\" src=\"http://localhost/odc_web/wp-content/uploads/2022/07/IMG_4382-2048x1536.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Kalanso</h3><p>L’école de codage est un centre technologique librement accessible et totalement gratuit qui propose des formations et des événements pour la communauté des jeunes développeurs, des enfants fous et des personnes ayant des idées de projets. Il s’adresse particulièrement aux étudiants, aux jeunes diplômés et aux jeunes entrepreneurs.</p>		\n			<figure><img width=\"696\" height=\"535\" src=\"http://localhost/odc_web/wp-content/uploads/2022/07/fab-lab-logo-ours-transparent-2.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Fablab Solidaire</h3><p>Le FabLab Solidarity est un atelier de production numérique pour la création et le prototypage avec des équipements numériques, tels que des imprimantes 3D, des fraiseuses et des découpeuses laser. Il rassemble à la fois des jeunes chômeurs et sans qualification ainsi que des étudiants, des jeunes diplômés et de jeunes entrepreneurs.</p>		\n			<figure><img width=\"696\" height=\"535\" src=\"http://localhost/odc_web/wp-content/uploads/2022/07/11-2.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Orange Fab</h3><p>Orange Fab est un accélérateur de startups dont l’objectif est de construire des partenariats commerciaux nationaux et internationaux avec le groupe Orange et le réseau international Orange Fab. Ce programme aide à améliorer les capacités managériales et fournit un soutien au développement commercial de startups prometteuses, et il s’adresse principalement aux entrepreneurs.</p>		\n			<h2>Nos réalisations</h2>		\n								<figure><img src=\"http://localhost/odc_web/wp-content/uploads/2022/07/lesapprenant-150x150.jpg\" alt=\"lesapprenant\" /></figure><figure><img src=\"http://localhost/odc_web/wp-content/uploads/2022/07/Fablab1-150x150.jpg\" alt=\"Fablab1\" /></figure><figure><img src=\"http://localhost/odc_web/wp-content/uploads/2022/07/295087112_353064290331689_7407821926836529014_n-150x150.jpg\" alt=\"295087112_353064290331689_7407821926836529014_n\" /></figure><figure><img src=\"http://localhost/odc_web/wp-content/uploads/2022/07/orange-640x445-1-150x150.jpg\" alt=\"orange-640x445\" /></figure>			\n												Précédent\n												Suivant', 'Bienvenue', '', 'publish', 'closed', 'closed', '', 'bienvenue', '', '', '2022-07-27 04:37:37', '2022-07-27 02:37:37', '', 0, 'http://localhost/odc_web/?page_id=8', 0, 'page', '', 0),
