(102, 1, '2022-07-27 03:13:23', '2022-07-27 01:13:23', '<h2>Nos activités</h2>		\n			<figure><img width=\"696\" height=\"522\" src=\"http://localhost/odc_web/wp-content/uploads/2022/07/IMG_4382-2048x1536.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Formation</h3><p>L’école de codage est un centre technologique librement accessible et totalement gratuit qui propose des formations et des événements pour la communauté des jeunes développeurs, des enfants fous et des personnes ayant des idées de projets. Il s’adresse particulièrement aux étudiants, aux jeunes diplômés et aux jeunes entrepreneurs.</p>		\n			<figure><img width=\"696\" height=\"535\" src=\"http://localhost/odc_web/wp-content/uploads/2022/07/fab-lab-logo-ours-transparent-2.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Fablab Solidaire</h3><p>Le FabLab Solidarity est un atelier de production numérique pour la création et le prototypage avec des équipements numériques, tels que des imprimantes 3D, des fraiseuses et des découpeuses laser. Il rassemble à la fois des jeunes chômeurs et sans qualification ainsi que des étudiants, des jeunes diplômés et de jeunes entrepreneurs.</p>		\n			<figure><img width=\"696\" height=\"463\" src=\"http://localhost/odc_web/wp-content/uploads/2022/07/11.jpg\" alt=\"\" loading=\"lazy\" /></figure><h3>Orange Fab</h3><p>Orange Fab est un accélérateur de startups dont l’objectif est de construire des partenariats commerciaux nationaux et internationaux avec le groupe Orange et le réseau international Orange Fab. Ce programme aide à améliorer les capacités managériales et fournit un soutien au développement commercial de startups prometteuses, et il s’adresse principalement aux entrepreneurs.</p>', 'Acceuil', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2022-07-27 03:13:23', '2022-07-27 01:13:23', '', 8, 'http://localhost/odc_web/?p=102', 0, 'revision', '', 0),
